    def _isRayIntersectsSegment(self, poi,s_poi,e_poi) -> bool:
        if s_poi[1]==e_poi[1]:
            return False
        if s_poi[1]>poi[1] and e_poi[1]>poi[1]:
            return False
        if s_poi[1]<poi[1] and e_poi[1]<poi[1]:
            return False
        if s_poi[1]==poi[1] and e_poi[1]>poi[1]:
            return False
        if e_poi[1]==poi[1] and s_poi[1]>poi[1]:
            return False
        if s_poi[0]<poi[0] and e_poi[1]<poi[1]:
            return False
        xseg=e_poi[0]-(e_poi[0]-s_poi[0])*(e_poi[1]-poi[1])/(e_poi[1]-s_poi[1])
        if xseg<poi[0]:
            return False
        return True
    def isPoiWithinPoly(self, poi) -> bool:
        sinsc = 0
        for i in range(len(self.data) - 1):
            s_poi=self.data[i]
            e_poi=self.data[i+1]
            if self._isRayIntersectsSegment(poi, s_poi, e_poi):
                sinsc += 1
        return True if sinsc%2==1 else  False
